            width: min(80lvw, 80lvh);
            height: min(80lvw, 80lvh);

            top: min(10lvw, 10lvh);
            left: min(10lvw, 10lvh);
            position: absolute;

            top: 0;
            position: absolute;
            z-index: 3;
            width: min(110lvw, 110lvh);

            top: max(-25lvw, -25lvh);
            position: absolute;
            z-index: 0;
            width: min(150lvw, 150lvh);
            image-rendering: pixelated;

            left: 0;
            top: max(-5lvw, -5lvh);
            position: absolute;
            z-index: 2;
            mix-blend-mode: screen;

            width: min(100lvw, 100lvh);
            left: 0;
            top: max(-5lvw, -5lvh);
            position: absolute;
            z-index: 1;
        }

            margin: auto;
            overflow: hidden;
            position: relative;

            width: min(100lvw, 100lvh);
            height: min(100lvw, 100lvh);
            overflow: hidden;
            position: relative;
            filter: url(#rainbow)

<script>
    
    const sleep = ms => new Promise(r => setTimeout(r, ms));

    async function hideAndShow() {
        const everything = document.querySelectorAll('path, ellipse, image')
        const patterns = document.querySelectorAll('pattern')
        for (const element of everything) {
            element.style.visibility = 'hidden';
        }
        for (const element of patterns) {
            element.style.visibility = 'hidden';
        }
        const bot = document.getElementById('bot');
        bot.setAttribute('visibility', '');
        const screens = document.getElementById('screens');
        screens.setAttribute('visibility', '');
        const shadows = document.getElementById('shadows');
        shadows.setAttribute('visibility', '');
        await sleep(100);
        for (const element of everything) {
            show(element);
            await sleep(5);
        }
        for (const element of patterns) {
            element.style.visibility = '';
            await sleep(50);
        }
    }

    async function show(element) {
        element.style.visibility = '';
        const fill = element.style.fill;
        element.style.fill = 'coral';
        await sleep(40);
        element.style.fill = 'orange';
        await sleep(40);
        element.style.fill = 'darkorange';
        await sleep(300);
        element.style.fill = fill;
    }

    let xPos = 0;
    let yPos = 0;
    let mouseX = 0;
    let mouseY = 0;
    let w = 0;

    function animate() {
        // Request for the browser to call animate() again before the next repaint
        requestAnimationFrame(animate);

        const viewportWidth = window.innerWidth;
        const viewportHeight = window.innerHeight;
        
        xPos = xPos + 0.05 * (mouseX - xPos);
        yPos = yPos + 0.05 * (mouseY - yPos);
        w += 0.02;

        const x = xPos + .02 * Math.sin(w) + .02 * Math.sin(w * 0.4987) + .02 * Math.sin(w * 1.1987) + Math.sign(Math.sin(w * .10103)) * .5 * Math.pow(Math.sin(w * .10103), 400);
        const y = yPos + .02 * Math.cos(w) + .02 * Math.cos(w * 0.4187) + .02 * Math.cos(w * 1.4987) + Math.sign(Math.cos(w * .10103)) * .5 * Math.pow(Math.cos(w * .10103), 400);

        const angleX = x * 180 / 5;
        const angleY = y * -180 / 5;
        const x2 = Math.pow(2 * x, 4) / 2 * Math.sign(x) * Math.min(viewportWidth, viewportHeight) / 10;
        const y2 = Math.pow(2 * y, 4) / 2 * Math.sign(y) * Math.min(viewportWidth, viewportHeight) / 10;

        const bot = document.getElementById('bot');
        bot.style.transform = `rotate3d(1,0,0,${angleY}deg) rotate3d(0,1,0,${angleX}deg) translateZ(20lvw)`;
        const screens = document.getElementById('screens');
        screens.style.transform = `rotate3d(1,0,0,${angleY}deg) rotate3d(0,1,0,${angleX}deg)`;
        const background = document.getElementById('background');
        background.style.transform = `rotate3d(1,0,0,${angleY}deg) rotate3d(0,1,0,${angleX}deg) translateZ(-40lvw)`;
        
        document.getElementById('gaussian').setAttribute('stdDeviation', `${Math.abs(x2)} ${Math.abs(y2)}`);
        document.getElementById('offset1').setAttribute('dx', `${x2 * -2}`);
        document.getElementById('offset1').setAttribute('dy', `${y2 * -2}`);
        document.getElementById('offset2').setAttribute('dx', `${x2 * 2}`);
        document.getElementById('offset2').setAttribute('dy', `${y2 * 2}`);
    }

    hideAndShow();
    animate();

    function mouseMoved(mx, my) {
        const viewportWidth = window.innerWidth;
        const viewportHeight = window.innerHeight;
        mouseX = mx / viewportWidth - 0.5;
        mouseY = my / viewportHeight - 0.5;
    }
    document.addEventListener('mousemove', function (event) {
        mouseMoved(event.clientX, event.clientY);
    });

    document.addEventListener('touchmove', function (event) {
        event.preventDefault(); 

        if (targetTouches.length == 0) return;
        mouseMoved(targetTouches[0].clientX, targetTouches[0].clientY);

    });
</script>
